import numpy as np

def EOS_Matrix(options):
    """
    Given the background n (the number current vectors), compute the matrix relating \delta n to \delta \mu.

    Parameters
    ----------

    options : dict
              All options
    """

    n = options['n_bg']
    EOS_Derivatives = options['EOS_Derivatives']
    dLdn, d2Ldn = EOS_Derivatives(n, options)

    M = np.zeros((2, 2, 2, 2))

    # Metric
    g = np.eye(2)
    g[0, 0] = -1.0

    # Lower the index on n
    nd = np.zeros_like(n)
    for XX in range(2):
        nd[XX, :] = (np.dot(n[XX, :], g)).T

    for a in range(2):
        for b in range(2):
            for X1 in range(2):
                Y1 = np.mod(1+X1, 2)
                M[X1, X1, a, b] = -2.0 * dLdn[X1] * g[a,b] + \
                    4.0 * d2Ldn[X1,X1]* nd[X1,a]*nd[X1,b] + \
                    2.0 * d2Ldn[X1,2 ]*(nd[X1,a]*nd[Y1,b]+nd[X1,b]*nd[Y1,a]) + \
                    d2Ldn[2,2] * nd[Y1,a] * nd[Y1,b]
                # Off-diagonals
                M[X1, Y1, a, b] = -dLdn[2]*g[a,b] + \
                    4.0 * d2Ldn[X1,Y1]*nd[X1,a]*nd[Y1,b] + \
                    2.0 * (d2Ldn[X1,2]*nd[X1,a]*nd[X1,b]+d2Ldn[Y1,2]*nd[Y1,b]*nd[Y1,a]) + \
                    d2Ldn[2,2]*nd[Y1,a]*nd[X1,b]

    return M


def calc_roots(options):
    """
    Calculate the roots - essentially eigenvalues of the associated matrix.

    Parameters
    ----------

    options : dict
              All possible options
    """

    if (not 'r' in options):
        M = EOS_Matrix(options)
        options['Mtt'] = M[:, :, 0, 0].reshape(2, 2)
        options['Mtx'] = M[:, :, 0, 1].reshape(2, 2)
        options['Mxt'] = M[:, :, 1, 0].reshape(2, 2)
        options['Mxx'] = M[:, :, 1, 1].reshape(2, 2)
    Mtt = options['Mtt']
    Mtx = options['Mtx']
    Mxt = options['Mxt']
    Mxx = options['Mxx']

    p = np.zeros(5)

    p[0] = 1.0
    # In this variant the omega has been factored out, so roots should depend only on the background
    p[1] = -(-Mxx[0,1] * Mxt[1,0] - Mxx[0,1] * Mtx[1,0] - Mxt[0,1] * Mxx[1,0] - Mtx[0,1] * Mxx[1,0] + Mxx[0,0] * Mxt[1,1] + Mxx[0,0] * Mtx[1,1] + Mxt[0,0] * Mxx[1,1] + Mtx[0,0] * Mxx[1,1]) / (-Mxx[0,1] * Mxx[1,0] + Mxx[0,0] * Mxx[1,1])
    p[2] = (Mxx[0,0] * Mtt[1,1] + Mtt[0,0] * Mxx[1,1] - Mxx[0,1] * Mtt[1,0] - Mtt[0,1] * Mxx[1,0] + Mxt[0,0] * Mxt[1,1] + Mxt[0,0] * Mtx[1,1] + Mtx[0,0] * Mxt[1,1] + Mtx[0,0] * Mtx[1,1] - Mxt[0,1] * Mxt[1,0] - Mxt[0,1] * Mtx[1,0] - Mtx[0,1] * Mxt[1,0] - Mtx[0,1] * Mtx[1,0]) / (-Mxx[0,1] * Mxx[1,0] + Mxx[0,0] * Mxx[1,1])
    p[3] = -(Mxt[0,0] * Mtt[1,1] + Mtx[0,0] * Mtt[1,1] + Mtt[0,0] * Mxt[1,1] + Mtt[0,0] * Mtx[1,1] - Mxt[0,1] * Mtt[1,0] - Mtx[0,1] * Mtt[1,0] - Mtt[0,1] * Mxt[1,0] - Mtt[0,1] * Mtx[1,0]) / (-Mxx[0,1] * Mxx[1,0] + Mxx[0,0] * Mxx[1,1])
    p[4] = (Mtt[0,0] * Mtt[1,1] - Mtt[0,1] * Mtt[1,0]) / (-Mxx[0,1] * Mxx[1,0] + Mxx[0,0] * Mxx[1,1])

    r = np.roots(p)
    return r

