def calc_delta_n(t, x, options):
    """
    Compute the perturbations in spacetime at given points t, x.

    Parameters
    ----------

    t : float, array
        Time
    x : float, array
        Spatial location
    options : dict
              All other information.
    """

    delta_n = np.zeros((len(t), 2, 2, len(x)))

    a_max = options['a_max']
    L = options['L']

    for a in range(a_max):
        inv_L_delta_F = calc_inv_L_delta_F(t, a, options)
        for k in range(len(t)):
            for XX in range(2):
                for mu in range(2):
                    for i in range(len(x)):
                        delta_n[k, XX, mu, i] += \
                            2.0 * np.real(inv_L_delta_F[k, XX, mu]) * \
                            np.cos(np.pi * a * x[i] / L)
                        delta_n[k, XX, mu, i] -= \
                            2.0 * np.imag(inv_L_delta_F[k, XX, mu]) * \
                            np.sin(np.pi * a * x[i] / L)

    return delta_n
